Les Tambours du Bronx (&quot;the Drums of the Bronx&quot;) is a French industrial percussion band created in 1987. Les Tambours du Bronx has 17 musicians on stage surrounded by synthetic sounds, samples, and singing, all in time with the powerful rhythm. It built its reputation reviving drums from rough energetic music; a mixture of indus, afrobeat, drum'n'bass, hip-hop, rock, metal, hardcore and techno.

